import React, { PureComponent } from 'react'

class CartColumns extends PureComponent {


    render() {
        return (
            <div>
                <div className="container-fluid ">
                    <div className="row">
                        <div className="mx-auto">
                            <p className="text-uppercase"> Products</p>
                        </div>

                    </div>
                </div>


            </div>
        )
    }
}

export default CartColumns
